  <div>
    <img src={e.image}/>
    <h3>{e.name}</h3>
    <p>{e.info}</p>
    <p>{e.price}</p>
  </div>
  : ``
  )
  return (
    <h1>Hello From TourDetails Page</h1>
  )
}
